import React from "react";
import { Box, makeStyles } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    paddingTop: "8rem",
    color: "#949494",
    justifyContent: "center",
    fontFamily: "Manrope, sans-serif",

    [theme.breakpoints.down("xs")]: {
      display: "flex",
      paddingTop: "2rem",
      color: "#949494",
      justifyContent: "center",
      paddingLeft: "2rem",
      paddingRight: "2rem",
      paddingBottom: "1rem",
      textAlign: "center",
      fontFamily: "Manrope, sans-serif",
    },
  },
  email: {
    display: "flex",
    paddingTop: "1rem",
    color: "#949494",
    justifyContent: "center",
    fontFamily: "Manrope, sans-serif",

    [theme.breakpoints.down("xs")]: {
      display: "flex",
      paddingTop: "2rem",
      color: "#949494",
      justifyContent: "center",
      paddingLeft: "2rem",
      paddingRight: "2rem",
      paddingBottom: "1rem",
      textAlign: "center",
      fontFamily: "Manrope, sans-serif",
    },
  },
}));

export default function Footer() {
  const classes = useStyles();

  return (
    <Box>
      <p className={classes.root}>Telephone: +123456789</p>
      <p className={classes.email}>email: apartmenthunt@gmail.com</p>
    </Box>
  );
}
